import React from "react";

const Home = () => {
  return (
    <div className="p-10 text-center">
      <h1 className="text-3xl font-bold text-orange-600">Welcome to TradeTeens</h1>
      <p className="mt-4 text-gray-700">Learn trading the smart way!</p>
    </div>
  );
};

export default Home;
